

UPDATE `documento` SET `estado_placas`='V' WHERE `id` % 2 =1;

UPDATE `documento` SET `estado_placas`='F' WHERE `id` % 2 =0;

UPDATE `documento` SET `ruta_archivos`=concat("E:/",`ruta_archivos`) WHERE `id` % 2 =1;

UPDATE `documento` SET `ruta_archivos`=concat("F:/",`ruta_archivos`) WHERE `id` % 2 =0;